const WORDS = new Set(split_to_chunks(CONCATED_WORDS, 5));

const WORDS_4_NO_REPEAT = Array.from(new Set(split_to_chunks(POSSIBLE_MEDUYAKOT, 5)));

const WORDS_NO_REPEAT = WORDS_4_NO_REPEAT.filter(item => isIsogram(item));

function isIsogram(word) {
    let temp = word;
    let new_temp = temp.replace(/[א-ת]/gi, m => {

        if (FINAL_LETTERS.hasOwnProperty(m))

            return FINAL_LETTERS[m];

        else

            return m;

    });

    return !/(.).*\1|\d/i.test(new_temp)
}

function split_to_chunks(str, chunk_size) {
    const chunk_inds = Array.from(Array(str.length / chunk_size).keys());
    return chunk_inds.map(function (i) {
        return str.slice(i * chunk_size, (i + 1) * chunk_size)
    });
}

function calculate_meduyeket(date) {
    const [day, month, year] = date.split('.').map(function (x) {
        return parseInt(x);
    });
    const start_ts = new Date(2022, 0, 1).getTime();
    const date_ts = new Date(year, month - 1, day).getTime();
    const day_number = Math.round((date_ts - start_ts) / 86400000);
    const ind = (day_number * 10) % WORDS_NO_REPEAT.length;
    return [WORDS_NO_REPEAT[ind], WORDS_NO_REPEAT[ind + 1], WORDS_NO_REPEAT[ind + 2], WORDS_NO_REPEAT[ind + 3], WORDS_NO_REPEAT[ind + 4], WORDS_NO_REPEAT[ind + 5], WORDS_NO_REPEAT[ind + 6], WORDS_NO_REPEAT[ind + 7], WORDS_NO_REPEAT[ind + 8], WORDS_NO_REPEAT[ind + 9]];
}
